selector_to_html = {"a[href=\"#wichtige-begriffe\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">20.2. </span>Wichtige Begriffe<a class=\"headerlink\" href=\"#wichtige-begriffe\" title=\"Link to this heading\">#</a></h2><p>Die KI ist voller Fachbegriffe. Hier kannst du nachschlagen, wenn du auf einen Begriff st\u00f6\u00dft, den du nicht kennst.</p>", "a[href=\"#term-Entscheidungsbaum\"]": "<dt id=\"term-Entscheidungsbaum\">Entscheidungsbaum</dt><dd><p>Eine hierarchische Struktur, die Entscheidungen durch Regeln modelliert, z. B. \u201cIst das Alter &gt; 18?\u201d. Jeder Knoten repr\u00e4sentiert eine Regel, die die Daten aufteilt. (s. <a class=\"reference internal\" href=\"#term-Entscheidungsbaumlernen\"><span class=\"xref std std-term\">Entscheidungsbaumlernen</span></a>, <a class=\"reference internal\" href=\"#term-Gini-Unreinheit\"><span class=\"xref std std-term\">Gini-Unreinheit</span></a>)</p></dd>", "a[href=\"#term-k-Nachste-Nachbarn-Algorithmus\"]": "<dt id=\"term-k-Nachste-Nachbarn-Algorithmus\">k-N\u00e4chste-Nachbarn-Algorithmus</dt><dd><p>Ein Algorithmus, der Vorhersagen basierend auf den <span class=\"math notranslate nohighlight\">\\(k\\)</span> \u00e4hnlichsten <a class=\"reference internal\" href=\"#term-Datenpunkt\"><span class=\"xref std std-term\">Datenpunkten</span></a> trifft. Beispiel: Die 3 n\u00e4chsten Nachbarn eines Punktes bestimmen, ob er eher \u201cKatze\u201d oder \u201cHund\u201d ist. (s. <a class=\"reference internal\" href=\"#term-Distanzmasze\"><span class=\"xref std std-term\">Distanzma\u00dfe</span></a>)</p></dd>", "a[href=\"#term-Merkmal\"]": "<dt id=\"term-Merkmal\">Merkmal</dt><dd><p>Merkmale (engl. <em>features</em>) beschreiben die Eigenschaften eines <a class=\"reference internal\" href=\"#term-Datenpunkt\"><span class=\"xref std std-term\">Datenpunkts</span></a>. Beispiel: In einem Datensatz \u00fcber Personen k\u00f6nnten Merkmale wie <em>Alter</em> oder <em>K\u00f6rpergr\u00f6\u00dfe</em> enthalten sein.</p></dd>", "a[href=\"#kunstliche-intelligenz-einfuhrung\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">20. </span>K\u00fcnstliche Intelligenz: Einf\u00fchrung<a class=\"headerlink\" href=\"#kunstliche-intelligenz-einfuhrung\" title=\"Link to this heading\">#</a></h1><p>Die K\u00fcnstliche Intelligenz ist ein weites Feld, das man aus verschiedenen Perspektiven betrachten kann.</p><p>F\u00fcrs Abitur am TG Informationstechnik sind im Augenblick nur die folgenden Themen relevant - und in diesem Skript werden deshalb auch nur sie ausf\u00fchrlich behandelt. In unserem <em>Moodle-Kurs</em> findest du weitere Materialien, insb. zu den gesellschaflichen Auswirkungen von KI und dazu, wie du selbst KI nutzen kannst, sollst, darfst (und an manchen Stellen auch besser <em>nicht</em> nutzen sollst oder darfst) .</p>", "a[href=\"#term-Label\"]": "<dt id=\"term-Label\">Label</dt><dd><p>Die bekannte Zielgr\u00f6\u00dfe oder Kategorie eines <a class=\"reference internal\" href=\"#term-Datenpunkt\"><span class=\"xref std std-term\">Datenpunkts</span></a>, z. B. \u201cSpam\u201d oder \u201cNicht-Spam\u201d. (s. <a class=\"reference internal\" href=\"#term-Gelabelte-vs-ungelabelte-Daten\"><span class=\"xref std std-term\">Gelabelte vs ungelabelte Daten</span></a>)</p></dd>", "a[href=\"#term-Eifriger-Lerner\"]": "<dt id=\"term-Eifriger-Lerner\">Eifriger Lerner</dt><dd><p>Ein Ansatz, bei dem das Modell vollst\u00e4ndig trainiert wird, bevor es Vorhersagen trifft. Beispiele: <a class=\"reference internal\" href=\"#term-Entscheidungsbaumlernen\"><span class=\"xref std std-term\">Entscheidungsbaumlernen</span></a>, <span class=\"xref std std-term\">Neuronales Netz</span>. (s. <a class=\"reference internal\" href=\"#term-Fauler-Lerner\"><span class=\"xref std std-term\">Fauler Lerner</span></a>)</p></dd>", "a[href=\"#term-Testdaten\"]": "<dt id=\"term-Testdaten\">Testdaten</dt><dd><p>Daten, die verwendet werden, um die Leistung eines Modells zu \u00fcberpr\u00fcfen. Beispiel: Neue Daten, die das Modell vorher nicht gesehen hat. (s. <a class=\"reference internal\" href=\"#term-Trainingsdaten\"><span class=\"xref std std-term\">Trainingsdaten</span></a>)</p></dd>", "a[href=\"#term-Manhattan-Distanz\"]": "<dt id=\"term-Manhattan-Distanz\">Manhattan-Distanz</dt><dd><p>Eine <a class=\"reference internal\" href=\"#term-Distanzmasze\"><span class=\"xref std std-term\">Distanzmetrik</span></a>, die die Summe der absoluten Differenzen zwischen den Koordinaten zweier Punkte berechnet. Beispiel: Die Manhattan-Distanz zwischen den Punkten (1, 2) und (4, 6) betr\u00e4gt <span class=\"math notranslate nohighlight\">\\(|1-4| + |2-6| = 7\\)</span>.</p></dd>", "a[href=\"#term-Euklidische-Distanz\"]": "<dt id=\"term-Euklidische-Distanz\">Euklidische Distanz</dt><dd><p>Eine <a class=\"reference internal\" href=\"#term-Distanzmasze\"><span class=\"xref std std-term\">Distanzmetrik</span></a>, welche die direkte Strecke (Luftlinie) zwischen zwei Punkten misst. Sie wird berechnet, indem man die Differenzen der Koordinaten quadriert, addiert und daraus die Wurzel zieht. Beispiel: Die Euklidische Distanz zwischen den Punkten (1, 2) und (4, 6) betr\u00e4gt <span class=\"math notranslate nohighlight\">\\(\\sqrt{(1-4)^2 + (2-6)^2} = \\sqrt{9 + 16} = 5\\)</span>.</p></dd>", "a[href=\"#term-Trainingsdaten\"]": "<dt id=\"term-Trainingsdaten\">Trainingsdaten</dt><dd><p>Daten, die verwendet werden, um ein Modell zu trainieren. Beispiel: Ein Datensatz mit Bildern von Katzen und Hunden, den das Modell verwendet, um sie zu unterscheiden. (s. <a class=\"reference internal\" href=\"#term-Testdaten\"><span class=\"xref std std-term\">Testdaten</span></a>)</p></dd>", "a[href=\"#term-Distanzmasze\"]": "<dt id=\"term-Distanzmasze\">Distanzma\u00dfe</dt><dd><p>Metriken zur Messung der \u00c4hnlichkeit oder Unterschiedlichkeit zwischen <a class=\"reference internal\" href=\"#term-Datenpunkt\"><span class=\"xref std std-term\">Datenpunkten</span></a>. Beispiele: <a class=\"reference internal\" href=\"#term-Euklidische-Distanz\"><span class=\"xref std std-term\">Euklidische Distanz</span></a>, <a class=\"reference internal\" href=\"#term-Manhattan-Distanz\"><span class=\"xref std std-term\">Manhattan-Distanz</span></a>.</p></dd>", "a[href=\"#term-Fauler-Lerner\"]": "<dt id=\"term-Fauler-Lerner\">Fauler Lerner</dt><dd><p>Ein Ansatz, bei dem das Modell erst zur Laufzeit (also bei einer Anfrage) trainiert wird, anstatt vorher. Beispiele: <a class=\"reference internal\" href=\"#term-k-Nachste-Nachbarn-Algorithmus\"><span class=\"xref std std-term\">K-N\u00e4chste-Nachbarn-Algorithmus</span></a>. (s. <a class=\"reference internal\" href=\"#term-Eifriger-Lerner\"><span class=\"xref std std-term\">Eifriger Lerner</span></a>)</p></dd>", "a[href=\"#term-Uberwachtes-Lernen\"]": "<dt id=\"term-Uberwachtes-Lernen\">\u00dcberwachtes Lernen</dt><dd><p>Eine Lernmethode, bei der das Modell mit gelabelten Daten trainiert wird. Beispiel: Ein Modell lernt, Spam von Nicht-Spam zu unterscheiden. (s. <a class=\"reference internal\" href=\"#term-Gelabelte-vs-ungelabelte-Daten\"><span class=\"xref std std-term\">Gelabelte vs ungelabelte Daten</span></a>)</p></dd>", "a[href=\"#term-Gelabelte-vs-ungelabelte-Daten\"]": "<dt id=\"term-Gelabelte-vs-ungelabelte-Daten\">Gelabelte vs ungelabelte Daten</dt><dd><p><strong>Gelabelte Daten</strong> enthalten sowohl Eingabewerte (<a class=\"reference internal\" href=\"#term-Merkmal\"><span class=\"xref std std-term\">Features</span></a>) als auch die zugeh\u00f6rigen Zielwerte (<a class=\"reference internal\" href=\"#term-Label\"><span class=\"xref std std-term\">Labels</span></a>). Sie werden f\u00fcr <strong>\u00fcberwachtes Lernen</strong> verwendet. Beispiel: Bilder von Tieren mit der Angabe \u201cHund\u201d oder \u201cKatze\u201d.<br/>\n<strong>Ungelabelte Daten</strong> enthalten nur Eingabewerte ohne Zielwerte. Sie werden f\u00fcr <strong>un\u00fcberwachtes Lernen</strong> verwendet, um Muster oder Strukturen zu erkennen. Beispiel: Kundenkaufdaten ohne vordefinierte Kategorien. (s. <a class=\"reference internal\" href=\"#term-Uberwachtes-Lernen\"><span class=\"xref std std-term\">\u00dcberwachtes Lernen</span></a>, <a class=\"reference internal\" href=\"#term-Unuberwachtes-Lernen\"><span class=\"xref std std-term\">Un\u00fcberwachtes Lernen</span></a>)</p></dd>", "a[href=\"#term-Minimax-Algorithmus\"]": "<dt id=\"term-Minimax-Algorithmus\">Minimax-Algorithmus</dt><dd><p>Ein Entscheidungsalgorithmus, der in Spielen wie Schach verwendet wird, um optimale Z\u00fcge zu finden. Beispiel: Der Algorithmus berechnet den besten Zug, indem er den schlechtesten Zug des Gegners minimiert. (s. <a class=\"reference internal\" href=\"#term-Entscheidungsbaum\"><span class=\"xref std std-term\">Entscheidungsbaum</span></a>)</p></dd>", "a[href=\"#term-Gini-Unreinheit\"]": "<dt id=\"term-Gini-Unreinheit\">Gini-Unreinheit</dt><dd><p>Ein Ma\u00df f\u00fcr die Reinheit eines Knotens in einem <a class=\"reference internal\" href=\"#term-Entscheidungsbaum\"><span class=\"xref std std-term\">Entscheidungsbaum</span></a>. Ein Wert von 0 bedeutet, dass alle Daten zur gleichen Kategorie geh\u00f6ren.</p></dd>", "a[href=\"#term-Underfitting\"]": "<dt id=\"term-Underfitting\">Underfitting</dt><dd><p>Die Situation, wenn ein Modell zu einfach ist und die zugrunde liegenden Muster in den <a class=\"reference internal\" href=\"#term-Trainingsdaten\"><span class=\"xref std std-term\">Trainingsdaten</span></a> nicht erfasst. Beispiel: Ein Modell, das eine komplexe Beziehung als gerade Linie darstellt. (s. <a class=\"reference internal\" href=\"#term-Overfitting\"><span class=\"xref std std-term\">Overfitting</span></a>)</p></dd>", "a[href=\"#ki-themen-die-furs-abitur-in-informationstechnik-relevant-sind\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">20.1. </span>KI-Themen, die f\u00fcrs Abitur in Informationstechnik relevant sind<a class=\"headerlink\" href=\"#ki-themen-die-furs-abitur-in-informationstechnik-relevant-sind\" title=\"Link to this heading\">#</a></h2>", "a[href=\"#term-Entscheidungsbaumlernen\"]": "<dt id=\"term-Entscheidungsbaumlernen\">Entscheidungsbaumlernen</dt><dd><p>Ein Algorithmus, der einen <a class=\"reference internal\" href=\"#term-Entscheidungsbaum\"><span class=\"xref std std-term\">Entscheidungsbaum</span></a> erstellt, indem er die Daten basierend auf Kriterien wie der <a class=\"reference internal\" href=\"#term-Gini-Unreinheit\"><span class=\"xref std std-term\">Gini-Unreinheit</span></a> aufteilt.</p></dd>", "a[href=\"#term-Datenpunkt\"]": "<dt id=\"term-Datenpunkt\">Datenpunkt</dt><dd><p>Eine einzelne Beobachtung in einem Datensatz, bestehend aus <a class=\"reference internal\" href=\"#term-Merkmal\"><span class=\"xref std std-term\">Features</span></a> und ggf. einem <a class=\"reference internal\" href=\"#term-Label\"><span class=\"xref std std-term\">Label</span></a>. Beispiel: Ein Datenpunkt k\u00f6nnte das Alter und Gewicht einer Person enthalten.</p></dd>", "a[href=\"#term-Klassifikation\"]": "<dt id=\"term-Klassifikation\">Klassifikation</dt><dd><p>Eine Form des <a class=\"reference internal\" href=\"#term-Uberwachtes-Lernen\"><span class=\"xref std std-term\">\u00fcberwachten Lernens</span></a>, bei der ein Modell Eingabedaten einer oder mehreren Kategorien zuordnet. Beispiel: Ein Modell klassifiziert E-Mails als \u201cSpam\u201d oder \u201cNicht-Spam\u201d. (s. <span class=\"xref std std-term\">Regression</span>)</p></dd>", "a[href=\"#term-Overfitting\"]": "<dt id=\"term-Overfitting\">Overfitting</dt><dd><p>Die Situation, wenn ein Modell die <a class=\"reference internal\" href=\"#term-Trainingsdaten\"><span class=\"xref std std-term\">Trainingsdaten</span></a> zu genau lernt und dadurch schlecht auf neue Daten generalisiert. Beispiel: Ein Modell, das jeden Datenpunkt \u201causwendig\u201d gelernt hat. (s. <a class=\"reference internal\" href=\"#term-Underfitting\"><span class=\"xref std std-term\">Underfitting</span></a>, <span class=\"xref std std-term\">Regularisierung</span>)</p></dd>", "a[href=\"#term-Unuberwachtes-Lernen\"]": "<dt id=\"term-Unuberwachtes-Lernen\">Un\u00fcberwachtes Lernen</dt><dd><p>Eine Methode, bei der ein Modell mit ungelabelten Daten trainiert wird, um Muster oder Strukturen zu erkennen. Beispiel: Gruppieren von Kunden nach ihren Kaufgewohnheiten. (s. <a class=\"reference internal\" href=\"#term-Gelabelte-vs-ungelabelte-Daten\"><span class=\"xref std std-term\">Gelabelte vs ungelabelte Daten</span></a>)</p></dd>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }
            link.classList.add('has-tippy');
            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: false,
                placement: 'auto-start', maxWidth: 500, interactive: true, boundary: document.body, appendTo: document.body,
                onShow(instance) {MathJax.typesetPromise([instance.popper]).then(() => {var isFirefox=typeof InstallTrigger!=='undefined';if(isFirefox&&window.MathJax&&MathJax.startup&&MathJax.startup.output&&MathJax.startup.output.name==="SVG"){const svgs=instance.popper.querySelectorAll('svg');svgs.forEach(svg=>{let bbox=svg.getBBox(),x=bbox.x,y=bbox.y,width=bbox.width,height=bbox.height;svg.setAttribute('width',width);svg.setAttribute('height',height);svg.setAttribute('viewBox',`${x} ${y} ${width} ${height}`);});let rescale=0.015;svgs.forEach(svg=>{let bbox=svg.getBBox(),width=bbox.width,height=bbox.height;svg.setAttribute('width',width*rescale);svg.setAttribute('height',height*rescale);});}});},
            });
        };
    };
    console.log("tippy tips loaded!");
};
